INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 1, 2, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, "お！\nあそこに困ってそうな人発見！", 1, "春咲 ひより", 0, 1, 1001);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 1, 2, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, "大切な人を\n守れるようになりたい…って", 1, "草野 優衣", 0, 1, 1002);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "少しは磨かれると思いますよ。", 0, 0, 1, 2, "フェンシングを始めてみては？", 0, 0, "キミに必要な集中力と感性が", 1, "士条 怜", 0, 1, 1003);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 1, 2, "ねぇ、にいちゃん！", 0, 0, "今日はなにして遊ぶ？", 1, "穂高 みそぎ", 0, 1, 1004);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "私といっしょに…\nいかない？", 0, 0, 1, 2, "風宮あかりです", 0, 0, "ねぇ…", 1, "風宮 あかり", 0, 1, 1006);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "食べ物の恨みは怖いのー", 0, 0, 1, 2, "出雲宮子なのー", 0, 0, "プリンたべたいのー", 1, "出雲 宮子", 0, 1, 1007);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "いいよ。\n見られることは運命さ…", 0, 0, 1, 2, "ボクは虹村雪。", 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, "虹村 雪", 0, 1, 1008);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "人呼んで「疾風の冥姫」!!", 0, 0, 1, 2, "フッ…聞いて後悔するがいい！", 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, "柊杏奈", 0, 1, 1009);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "ほんまおおきにやわ～♪", 0, 0, 1, 2, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, "姫宮 真歩", 0, 1, 1010);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ここで会ったが\n100年目～！", 0, 0, 1, 2, "衣之咲璃乃です！", 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, "衣之咲 璃乃", 0, 1, 1011);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 1, 2, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, "ち、超能力って…\n何のことかな～？", 1, "柏崎 初音", 0, 1, 1012);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 1, 2, "ちょす！\n美波鈴奈だよ～♪", 0, 0, "一応カリスマ読モJKやってまっす！", 1, "美波 鈴奈", 0, 1, 1016);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "でも、沖縄もとってもいいとこさー", 0, 0, 1, 2, "はいたーい。\n喜屋武香織さー。", 0, 0, "東京は遊園地みたいなところさー", 1, "喜屋武 香織", 0, 1, 1017);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "イオちゃんって呼んでね。", 0, 0, 1, 2, "支倉伊緒です。", 0, 0, "先生って呼ばれるのは\nくすぐったいから", 1, "支倉 伊緒", 0, 1, 1018);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "ミミをおいてかないでぇ～", 0, 0, 1, 2, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, "茜 ミミ", 0, 1, 1020);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "ふぇぇぇぇぇん……", 0, 0, 1, 2, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, "あの……\nふぇ……", 1, "栗林 くるみ", 0, 1, 1021);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "なんてありがとうございます！", 0, 0, 1, 2, "風宮よりです。\nあああああ！", 0, 0, "こんな私に貴重な時間を\n割いていただき、", 1, "風宮 より", 0, 1, 1022);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "私こっち行きたいー\nね、早く早くー", 0, 0, 1, 2, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, "おにいちゃんどこいくの？\nえ？", 1, "北条 綾音", 0, 1, 1023);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "これて何か違う…\nあああすみません！", 0, 0, 1, 2, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, "天野 すずめ", 0, 1, 1025);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "離しませんわ………\n絶対に…!!", 0, 0, 1, 2, "……クスクス…私は\n…倉石恵理子……", 0, 0, "あなたは…運命の……\n伴侶……", 1, "倉石 恵理子", 0, 1, 1027);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "…そうでしょ？？", 0, 0, 1, 2, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, "佐々木 咲恋", 0, 1, 1028);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "あはは、\n私もまだまだだなぁ～", 0, 0, 1, 2, "桜井望だよ！\nよろしくねっ", 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, "桜井 望", 0, 1, 1029);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 1, 2, "デケデケデンっ！", 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, "ニノン・ジュベール", 0, 1, 1030);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "おかしいですね……", 0, 0, 1, 2, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, "上喜 しのぶ", 0, 1, 1031);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 1, 2, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, "けんども\nそれには足りないモンが…", 1, "野戸まひる", 0, 1, 1033);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ちょ\nちょっと一杯飲んできます…！", 0, 0, 1, 2, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, "ちょっと緊張しちゃって…", 1, "綾瀬 ゆかり", 0, 1, 1034);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "これ以上お話しすることは…\nないです！", 0, 0, 1, 2, "氷川鏡華…です", 0, 0, "知らない人とは話しちゃいけないので", 1, "氷川 鏡華", 0, 1, 1036);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 1, 2, "柏崎…栞です。", 0, 0, "……あ、アラーム。", 1, "柏崎 栞", 0, 1, 1038);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "野に咲く花が、\n唯一の話相手です。", 0, 0, 1, 2, "ふ、双葉碧です。", 0, 0, "私、一人も友達がいなくて……", 1, "双葉 碧", 0, 1, 1040);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "そう思っています。", 0, 0, 1, 2, "三角千歌です。", 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, "三角 千歌", 0, 1, 1042);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "う、疑ってすまなかったな…", 0, 0, 1, 2, "安芸真琴だ。", 0, 0, "あぁ？\nお前のそいつの仲間か？", 1, "安芸 真琴", 0, 1, 1043);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 1, 2, "わらわこそは夜を総べる者！", 0, 0, "生けとし生ける全ての者よ！", 1, "イリヤ・オーンスタイン", 0, 1, 1044);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ｌク、クウカに何かご用ですか!?", 0, 0, 1, 2, "そこで騎士は妖精を乱暴に……", 0, 0, "ぐふふふふ……はっ！", 1, "遠見 空花", 0, 1, 1045);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 1, 2, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, "宮坂たまき", 0, 1, 1046);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 1, 2, "大神美冬よ！", 0, 0, "それでは早速クエストに…", 1, "大神 美冬", 0, 1, 1048);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 1, 2, "星野静流だよ！", 0, 0, "クエストもバトルも\n掃除も洗濯も", 1, "星野静流", 0, 1, 1049);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 1, 2, "アタシは玉泉美咲。", 0, 0, "見ての通りの\nセクシー美少女で", 1, "玉泉美咲", 0, 1, 1050);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "？？？？", 0, 0, 1, 2, "？？？", 0, 0, "？？？？", 1, "リマ", 0, 1, 1052);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 2, "モニカ・ヴァイスヴィントだ。", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィント", 0, 1, 1053);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 2, "モニカ・ヴァイスヴィントだ。", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "ペコリーヌ", 0, 1, 1058);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 2, "モニカ・ヴァイスヴィントだ。", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "コッコロ", 0, 1, 1059);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 2, "モニカ・ヴァイスヴィントだ。", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "キャル", 0, 1, 1060);
